    fontSize:'40px',
    textDecoration:'underline'

  }
  return (
    <div className="App">
      <h1 className="center" style={headerStyle}>
        <span className="glyphicon glyphicon-remove"></span>Tic-Tac-Toe
      </h1>
      <Board />
